Similar to Rust, Sway has what is colloquially known as the turbofish . The turbofish looks like this: ::<> (see the little fish with bubbles behind it?). The turbofish is used to annotate types in a generic context. Say you have the following function: fn foo<T, E>(t: T) -> Result<T, E> { Result::Ok(t)
} In this code example, which is admittedly asinine, you can't possibly know what type E is. You'd need to provide the type manually, with a turbofish: fn foo<T, E>(t: T) -> Result<T, E> { Result::<T, MyErrorType>::Ok(t)
} It is also common to see the turbofish used on the function itself: fn main() { foo::<Bar, Baz>()
